import React, { useState,useEffect } from 'react'
import Axios from 'axios'
function AddData() {
    const [movieName, setMovieName] = useState()
    const [year, setYear] = useState()
    const [plot, setPlot] = useState()
    const [actorList, setActorList]= useState([])
    const [producerList, setProducerList]= useState([])
    const [actor, setActor]= useState()
    const [producer, setProducer]= useState()
    const [actorName, setActorName]=useState()
    const [actorGender, setActorGender]= useState()
    const [actorDob, setActorDob]= useState()
    const [actorBio, setActorBio]=useState()
    const [producerName, setProducerName]=useState()
    const [producerGender, setProducerGender]= useState()
    const [producerDob, setProducerDob]= useState()
    const [producerBio, setProducerBio]=useState()
     useEffect(()=>{
        Axios.get("http://localhost:3001/actor").then((response)=>{
            setActorList(response.data)
        });
        Axios.get("http://localhost:3001/producer").then((response)=>{
            setProducerList(response.data)
        });
     },[]);
    const submitData = () => {

        Axios.post("http://localhost:3001/movie", {
            movieName: movieName,
            year: year,
            plot: plot,
            actor: actor,
            producer: producer

        }).then(
            console.log("Data inserted")
        );


    }

    const submitActorData = () => {

        Axios.post("http://localhost:3001/actor", {
            actorName: actorName,
            actorGender: actorGender,
            actorDob: actorDob,
            actorBio: actorBio
        }).then(
            console.log("Data inserted")
        );


    }
    const submitProducerData = () => {

        Axios.post("http://localhost:3001/producer", {
            producerName: producerName,
            producerGender: producerGender,
            producerDob: producerDob,
            producerBio: producerBio
        }).then(
            console.log("Data inserted")
        );


    }

   return (
    <div>
    <div className='form m-5 w-25'>
        <form className='form'>
        <label htmlFor="mo_name" className='form-label'>Movie Name</label>
        <input type="text" id="mo_name" className='form-control' required onChange={(e) => 
        setMovieName(e.target.value)        }/>

<label htmlFor="actList" className="form-label">Actor</label>
        <input className="form-control" list="actdata" id="actList"  onChange={(e) => 
        setActor(e.target.value)        }/>
         <datalist id="actdata">
            {actorList.map((val)=>{
             return <option value={val.Name}></option>
            })}
        </datalist>
        {/* <button type="" className='btn btn-warning' onClick={()=>{}}> New Actor </button> */}
        <label htmlFor="exampleDataList" className="form-label">Producer</label>
        <input className="form-control" list="datalistOptions" id="exampleDataList" onChange={(e) => 
        setProducer(e.target.value)        } />
         <datalist id="datalistOptions">
            {producerList.map((val)=>{
             return <option value={val.Name}></option>
            })}
        </datalist>
        <label htmlFor="mo_date" className='form-label'>Year of Release</label>
        <input type="text" id="mo_date" className='form-control' required onChange={(e) => 
        setYear(e.target.value) 
        }/>
        <label htmlFor="mo_plot" className='form-label'>Plot</label>
        <input type="text" id="mo_plot" className='form-control' required onChange={(e) => 
        setPlot(e.target.value) 
        }/>

        <button type="submit" onClick={() => submitData() } className='btn btn-primary  mt-3'>Submit</button>
        </form>
    </div>

    <div className='form m-5 w-25'>
    <form className='form'>
        <label htmlFor="act_name" className='form-label'>Actor Name</label>
        <input type="text" id="act_name" className='form-control' required onChange={(e) => 
        setActorName(e.target.value)        }/>
        <label htmlFor="act_gender" className='form-label'>Gender</label>
        <input type="text" id="act_gender" className='form-control'  onChange={(e) => 
        setActorGender(e.target.value) 
        }/>
        <label htmlFor="act_dob" className='form-label'>DOB</label>
        <input type="date" id="act_dob" className='form-control'  onChange={(e) => 
        setActorDob(e.target.value) 
        }/>
         <label htmlFor="act_bio" className='form-label'>Bio</label>
        <input type="date" id="act_bio" className='form-control'  onChange={(e) => 
        setActorBio(e.target.value) 
        }/>
        <button type="submit" onClick={() => submitActorData() } className='btn btn-primary  mt-3'>Submit</button>
        </form>
    </div>



    <div className='form m-5 w-25'>
    <form className='form'>
        <label htmlFor="prod_name" className='form-label'>Producer Name</label>
        <input type="text" id="prod_name" className='form-control' required onChange={(e) => 
        setProducerName(e.target.value)        }/>
        <label htmlFor="prod_gender" className='form-label'>Gender</label>
        <input type="text" id="prod_gender" className='form-control'  onChange={(e) => 
        setProducerGender(e.target.value) 
        }/>
        <label htmlFor="prod_dob" className='form-label'>DOB</label>
        <input type="date" id="prod_dob" className='form-control'  onChange={(e) => 
        setProducerDob(e.target.value) 
        }/>
         <label htmlFor="prod_bio" className='form-label'>Bio</label>
        <input type="te" id="prod_bio" className='form-control'  onChange={(e) => 
        setProducerBio(e.target.value) 
        }/>
        <button type="submit" onClick={() => submitProducerData() } className='btn btn-primary  mt-3'>Submit</button>
        </form>
    </div>
    </div>
   );



}
export default AddData
